import React from 'react'
import styled from "styled-components";

const Container=styled.div`
justify-content:center;
text-align:center;
align-items:center;
text-overflow: ellipsis;
`;
function Card() {
  return (
  <Container>Welcome to Ex-paper analysis.One stop place to get free from all exam related wories.</Container>
  )
}

export default Card;
